      onClick={props.handleClick !== undefined ? (e) => props.handleClick(props.canvasRef, e) : null}>
      {props.alt}
    </canvas>
  );
}

export default CSSModules(Canvas, styles, { allowMultiple: true, handleNotFoundStyleName: 'ignore' });
